import React from 'react';

const Items =(props) =>{
  return(
    <p>{props.partsName} {props.partsExercise}</p>
  )
}


const Course = (props) =>{
  return (
    <>
    <h1>{props.courseName}</h1>
    <Items />
    </>
  )
}




const App = () => {
  const course = {
    id: 1,
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10,
        id: 1
      },
      {
        name: 'Using props to pass data',
        exercises: 7,
        id: 2
      },
      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      }
    ]
  }

  return <Course courseName={course.name} 
                 partsName={course.parts[1].name}
                 partsExercise={course.parts[1].exercises}/>
}

export default App
